import React from 'react';
import { 
    Box, 
    Container, 
    Grid, 
    Card, 
    CardContent,
    Typography,
    IconButton,
    Tooltip,
    // Paper,
    // LinearProgress,
    Button,
    Divider
} from '@mui/material';
import AddIcon from '@mui/icons-material/Add';
import CalendarTodayIcon from '@mui/icons-material/CalendarToday';
// import SchoolIcon from '@mui/icons-material/School';
import AssignmentIcon from '@mui/icons-material/Assignment';
import SmartToyIcon from '@mui/icons-material/SmartToy';
// import TimerIcon from '@mui/icons-material/Timer';
import AutoGraphIcon from '@mui/icons-material/AutoGraph';
// import MenuBookIcon from '@mui/icons-material/MenuBook';

// Task Display Component
const TaskPreview = ({ task }) => {
    const getPriorityColor = (priority) => {
        switch (priority) {
            case 'high':
                return '#DC143C';
            case 'medium':
                return '#FFA500';
            case 'low':
                return '#4CAF50';
            default:
                return '#757575';
        }
    };

    return (
        <Box
            sx={{
                p: 2,
                background: 'rgba(255, 255, 255, 0.05)',
                borderRadius: 2,
                mb: 2,
                transition: 'transform 0.2s ease-in-out',
                '&:hover': {
                    transform: 'translateX(5px)',
                }
            }}
        >
            <Box sx={{ display: 'flex', alignItems: 'center', justifyContent: 'space-between', mb: 1 }}>
                <Typography variant="subtitle1" sx={{ color: '#fff', fontWeight: 500 }}>
                    {task.title}
                </Typography>
                <Chip
                    size="small"
                    label={task.priority}
                    sx={{
                        backgroundColor: `${getPriorityColor(task.priority)}20`,
                        color: getPriorityColor(task.priority),
                        fontWeight: 500,
                        textTransform: 'capitalize'
                    }}
                />
            </Box>
            {task.subject && (
                <Typography variant="caption" sx={{ color: 'rgba(255, 255, 255, 0.5)', display: 'block', mb: 1 }}>
                    {task.subject}
                </Typography>
            )}
            <Box sx={{ display: 'flex', alignItems: 'center', gap: 2 }}>
                <Box sx={{ display: 'flex', alignItems: 'center', gap: 0.5 }}>
                    <AccessTimeIcon sx={{ fontSize: 16, color: 'rgba(255, 255, 255, 0.5)' }} />
                    <Typography variant="caption" sx={{ color: 'rgba(255, 255, 255, 0.5)' }}>
                        {task.estimatedTime}h
                    </Typography>
                </Box>
            </Box>
        </Box>
    );
};

function Dashboard() {
    // These will be implemented later
    /*
    const studyMetrics = {
        totalStudyHours: 0,
        tasksCompleted: 0,
        upcomingExams: 0,
        nextStudySession: null
    };

    const studyPlan = {
        todaysFocus: [],
        progress: 0,
        nextBreak: null
    };
    */

    return (
        <Box
            sx={{
                minHeight: 'calc(100vh - 64px)',
                background: 'linear-gradient(135deg, #0A0A0F 0%, #1a1a1f 100%)',
                py: 6,
                position: 'relative',
                '&::before': {
                    content: '""',
                    position: 'absolute',
                    top: 0,
                    right: 0,
                    bottom: 0,
                    left: 0,
                    background: 'radial-gradient(circle at 50% 0%, rgba(220, 20, 60, 0.1) 0%, transparent 50%)',
                    pointerEvents: 'none'
                }
            }}
        >
            <Container maxWidth="xl">
                {/* AI Study Assistant Section - Prominent placement */}
                <Card
                    sx={{
                        mb: 4,
                        background: 'rgba(17, 17, 17, 0.8)',
                        backdropFilter: 'blur(20px)',
                        borderRadius: 3,
                        border: '1px solid rgba(255, 255, 255, 0.1)',
                    }}
                >
                    <CardContent sx={{ p: 3 }}>
                        <Box sx={{ display: 'flex', justifyContent: 'space-between', alignItems: 'center', mb: 2 }}>
                            <Typography variant="h5" sx={{ 
                                display: 'flex', 
                                alignItems: 'center', 
                                gap: 2,
                                color: 'rgba(255, 255, 255, 0.9)',
                            }}>
                                <SmartToyIcon sx={{ color: '#DC143C' }} />
                                AI Study Assistant
                            </Typography>
                            <Button
                                variant="contained"
                                startIcon={<SmartToyIcon />}
                                sx={{
                                    bgcolor: 'rgba(220, 20, 60, 0.8)',
                                    '&:hover': { bgcolor: 'rgba(220, 20, 60, 1)' }
                                }}
                            >
                                Open Assistant
                            </Button>
                        </Box>
                        <Divider sx={{ my: 2, bgcolor: 'rgba(255, 255, 255, 0.1)' }} />
                        <Grid container spacing={3}>
                            <Grid item xs={12} md={8}>
                                <Typography variant="subtitle1" color="rgba(255, 255, 255, 0.7)" gutterBottom>
                                    Current Study Plan
                                </Typography>
                                {/* This will be populated with AI-generated study plan */}
                                <Box sx={{ mt: 2 }}>
                                    {/* Study plan content will go here */}
                                </Box>
                            </Grid>
                            <Grid item xs={12} md={4}>
                                <Typography variant="subtitle1" color="rgba(255, 255, 255, 0.7)" gutterBottom>
                                    Study Metrics
                                </Typography>
                                {/* Real-time metrics will go here */}
                            </Grid>
                        </Grid>
                    </CardContent>
                </Card>

                <Grid container spacing={4}>
                    {/* Schedule Management Section */}
                    <Grid item xs={12} md={6}>
                        <Card
                            sx={{
                                height: '100%',
                                background: 'rgba(17, 17, 17, 0.6)',
                                backdropFilter: 'blur(20px)',
                                borderRadius: 3,
                                border: '1px solid rgba(255, 255, 255, 0.1)',
                            }}
                        >
                            <CardContent sx={{ height: '100%', p: 3 }}>
                                <Box sx={{ display: 'flex', justifyContent: 'space-between', alignItems: 'center', mb: 3 }}>
                                    <Typography variant="h6" sx={{ 
                                        display: 'flex', 
                                        alignItems: 'center', 
                                        gap: 1.5,
                                        color: 'rgba(255, 255, 255, 0.9)',
                                    }}>
                                        <CalendarTodayIcon sx={{ color: '#DC143C' }} />
                                        Schedule Manager
                                    </Typography>
                                    <Tooltip title="Manage Schedule">
                                        <IconButton sx={{ color: '#DC143C' }}>
                                            <AddIcon />
                                        </IconButton>
                                    </Tooltip>
                                </Box>
                                {/* Schedule management interface will go here */}
                                {/* Will include class schedule and exam date management */}
                            </CardContent>
                        </Card>
                    </Grid>

                    {/* Task Management Section */}
                    <Grid item xs={12} md={6}>
                        <Card
                            sx={{
                                height: '100%',
                                background: 'rgba(17, 17, 17, 0.6)',
                                backdropFilter: 'blur(20px)',
                                borderRadius: 3,
                                border: '1px solid rgba(255, 255, 255, 0.1)',
                            }}
                        >
                            <CardContent sx={{ height: '100%', p: 3 }}>
                                <Box sx={{ display: 'flex', justifyContent: 'space-between', alignItems: 'center', mb: 3 }}>
                                    <Typography variant="h6" sx={{ 
                                        display: 'flex', 
                                        alignItems: 'center', 
                                        gap: 1.5,
                                        color: 'rgba(255, 255, 255, 0.9)',
                                    }}>
                                        <AssignmentIcon sx={{ color: '#DC143C' }} />
                                        Task Manager
                                    </Typography>
                                    <Tooltip title="Add Task">
                                        <IconButton sx={{ color: '#DC143C' }}>
                                            <AddIcon />
                                        </IconButton>
                                    </Tooltip>
                                </Box>
                                {/* Task management interface will go here */}
                                {/* Will include task list, priority settings, and time estimates */}
                            </CardContent>
                        </Card>
                    </Grid>

                    {/* Study Analytics Section */}
                    <Grid item xs={12}>
                        <Card
                            sx={{
                                background: 'rgba(17, 17, 17, 0.6)',
                                backdropFilter: 'blur(20px)',
                                borderRadius: 3,
